    contentHTML:
      '<p style="text-align: center; line-height: 1.3"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 16.5pt">XX医院</span></p><p style="text-align: center; line-height: 1.3"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 16.5pt">放射科增强／造影检查知情同意书 </span></p><p style="text-align: center; line-height: 1.3"></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">患者姓名：_________  性别：___________    年龄：__________    卡号：______________</span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">根据患者的病情，经医生研究后提出需做增强或造影检查，该方法是一种帮助提高诊断和治疗的有效手段。检查时需注射含碘对比剂，加之患者个体的特殊体质等因素，该检查具有侵入性、 对比剂过敏等风险。先告知相关风险如下： </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">1、患者应向医务人员提供下列情况： </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">既往无使用碘剂发生不良反应的病史。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">无甲状腺功能亢进、严重心、肾功能不全，哮喘病史等。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">2、碘对比剂一般安全可靠，但有极少数患者因其体质特殊，可能发生难以预料的各种类型的 过敏反应（如皮瘆、痒感、呼吸困难、心慌等表现），严重者可导致过敏性休克甚至死亡。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">3、使用高压注射器时，存在针头脱落、局部血管破裂的潜在危险。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">4、注射部位可能出现碘对比剂渗漏到血管外，会引起患者皮下组织肿胀、疼痛、麻木感，甚 至溃烂、坏死。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">5、其他无法预料或难以防范的不良后果。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">6、增强或造影检查需要家属全程陪同。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">以上文本由医院提供，医务人员己详细告知了上述内容，我同意使用该文本，我已知晓了以上内 容，对上述各种潜在风险完全知情。经慎重考虑，我_______（同意／不同意）做该增增强或造影检 查。（此处下划线处内容须患者或法定代理人或委托人亲自填写） </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">我明白在本次检查中，在不可预见的情况下，可能需要其他附加操作或变更检查及治疗方案， 我授权医师在遇有紧急情况时，为保障惠者生命安全必要的救治措施，并保证承担全部费用。 </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">我知道在本次检查开始之前，我可以随时签署拒绝检查的意见，以取消知情同意书的决定。 </span></p><p style="line-height: 1.5"></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">患者（或法定代理人）签名：_________________ </span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">或委托代理人签名：_________________________</span></p><p style="line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">联系电话：_________________________________</span></p><p style="line-height: 1.5"></p><p style="text-align: right; line-height: 1.5"><span style="color: rgb(38, 38, 38); font-family: 宋体; font-size: 10.5pt">日期：   年   月   日</span></p>'
