    contentHTML:
      '<h2 style="text-align: center"><span style="color: rgb(0, 0, 0); font-family: 宋体; font-size: 16pt"><strong>实 习 协 议</strong></span></h2><p style="line-height: 1.5"></p><p style="line-height: 20pt"><span style="font-family: 宋体">甲方：<u>XXX科技有限公司</u> 注册地址：<u>成都市高新区天府大道中段588号</u></span></p><p style="line-height: 20pt"><span style="font-family: 宋体">乙方：<u> </u>身份证号码：</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">（甲方和乙方合称“双方”）</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">根据劳动法律法规的相关规定，甲乙双方本着平等、诚实守信的原则，经协商一致，就乙方至甲方实习，自愿签订本协议，共同遵守所列条款。</span></p><h3><span style="font-family: 宋体"><strong>一、人事关系</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">甲方同意乙方取得<u> </u>毕业证之前在甲方实习。甲乙双方均确认本协议不构成乙方与甲方的劳动关系，乙方不享受甲方雇员所享受的各种福利、保险及其他待遇。</span></p><h3><span style="font-family: 宋体"><strong>二、实习期限</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">年<u> </u>月<u> </u>日至<u> </u>年<u> </u>月<u> </u>日期间在甲方进行为期<u> </u>个月的实习。</span></p><h3><span style="font-family: 宋体"><strong>三、实习内容</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">甲方将安排乙方在甲方的________________部门进行实习。实习结束后，甲乙双方协商一致，乙方可招收为甲方正式员工。</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">甲方可以根据其需要和乙方的工作能力对实习内容进行调整。</span></p><h3><span style="font-family: 宋体"><strong>四、双方的权利和义务</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">1、甲方的权利和义务</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">1）在实习期内根据乙方的表现，甲方有权决定是否提前终止对乙方提供的实习机会。</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">2）甲方可按照本协议规定的时间和内容为乙方提供实习机会；在乙方严格遵守了实习时间和甲方各项规章的情况下，给予乙方每月或每天<u> </u>元（大写：<u> </u>）的补贴（含税）。</span><span style="color: rgb(0, 0, 0); font-family: 宋体">甲方提供正常合理的劳动安全条件。</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">2、乙方的权利和义务</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">1）乙方在协议规定的实习时间按照甲方安排的内容参加实习；在严格遵守了实习时间和甲方各项规章情况下，向甲方领取补贴。</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">2）乙方在实习期间，必须遵守甲方的有关工作时间、休假制度、考勤制度、安全规程、行为准则、保密制度及任何其它甲方要求乙方遵守的公司规定； 乙方应按时完成实习期间甲方交付的任务和工作；如乙方在甲方实习期间接受了甲方提供的定向培训，乙方应履行定向培训协议项下乙方的义务。乙方在执行本协议期间遭遇的一切风险，包括但不限于各种伤害和意外事故，除非该种伤害和意外事故是由于甲方的重大过失或故意造成的，由乙方自行承担。</span></p><h3><span style="font-family: 宋体"><strong>五、保险</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">在乙方实习期间，甲方为乙方购买意外伤害保险。</span></p><h3><span style="font-family: 宋体"><strong>六、协议的终止</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">因协议期限届满以外的其他原因而造成协议提前终止时，甲乙双方均应提前通知对方；</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">乙方违反本协议第四条有关乙方义务的规定，甲方可立即提前终止本协议。乙方应承担甲方由此所遭受的损失；</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">协议一旦提前终止，乙方和甲方的实习关系也随之提前终止。</span></p><h3><span style="font-family: 宋体"><strong>七、保密条款</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">1、乙方实习期间接触到的一切甲方信息均属甲方保密信息，包括但不限于：甲方的档案资料、各类合同、人事档案资料、行政文件、市场销售资料、经销商资料、市场推广计划、价位策略、销售渠道、销售办法、客户资料等（统称“保密信息”）。乙方承诺：未经甲方书面许可，乙方不得以任何形式自行复制、使用、或泄露任何保密信息给任何第三方。</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">2、乙方未经授权使用或披露信息可能会导致甲方遭受立即且不可挽回的损失，且该等损失可能是金钱赔偿所无法充分补救的。在该等情况下，乙方同意甲方可以寻求一切合理措施来阻止损失的扩大。一旦乙方违反其在本条款项下的义务，乙方同意向甲方赔偿由此引起或导致的甲方的一切经济损失（包括但不限于甲方为此遭受的或与之相关的所有索偿、要求、债务、损失、成本和费用，包括律师费用）。</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">3、不论本协议因任何原因终止，乙方在本保密条款项下的义务在终止后继续有效。本协议终止时，乙方应根据甲方要求办理实习工作交接，否则乙方应向甲方承担相应的损失。</span></p><h3><span style="font-family: 宋体"><strong>八、协议的生效</strong></span></h3><p style="line-height: 20pt"><span style="font-family: 宋体">本协议一式二份，由甲方、乙方各执一份，经双方合法授权代表签署后生效。</span></p><p style="line-height: 20pt"></p><p style="line-height: 20pt"><span style="font-family: 宋体">甲方：（公章）  </span></p><p style="line-height: 20pt"><span style="font-family: 宋体">代表人（签名）：     乙方：</span></p><p style="line-height: 20pt"><span style="font-family: 宋体">日期： 年  月  日         日期：</span></p><p style="line-height: 20pt"></p>'
