      "# 工作汇报 - [姓名/部门]  \n**日期**：YYYY-MM-DD  \n**周期**：本周/本月/第X季度（根据需求选择）\n\n---\n\n## 一、工作概述\n- 本周期主要工作方向：`简要说明核心工作目标`\n- 关键成果数量：`完成X项任务/推进X个项目`\n\n---\n\n## 二、重点工作进展\n### 1. 项目/任务A\n- **当前进度**：`具体进度百分比或阶段描述`\n- **成果亮点**：  \n  ✓ 完成XXX（可量化数据更佳）  \n  ✓ 解决XXX问题（举例说明）\n- **存在困难**：  \n  ⚠️ `需说明的阻塞问题（可选）`\n\n### 2. 项目/任务B\n- **当前进度**：`描述`\n- **协同情况**：`如需跨部门协作可在此说明`\n\n---\n\n## 三、问题与需求\n| 问题描述 | 影响程度 | 建议解决方案 | 需支持资源 |\n|---------|---------|-------------|-----------|\n| 示例：资源不足导致延期 | 高 | 增派1名人员 | 人力资源部协助 |\n\n---\n\n## 四、下周期计划\n* 计划一：`描述+预期目标`    \n* 计划二：`描述+预期目标`\n* 计划三： `描述+预期目标`\n---\n\n## 五、其他说明\n`可选补充内容（如学习成长、团队建设等）`",
    type: "markdown",
    title: "工作汇报"
